import React from "react";
import logo from '../../assets/img/logo.svg'
import tagline from '../../assets/img/motto'

const Header = () => {
  return (
    <>
      <header>
        <div>
          <img src={logo} class="logo" alt="" />
          <img src="./img/motto.svg" class="tagline" alt="" />
          <img src="./img/background.png" class="background_img" alt="" />
        </div>
      </header>
    </>
  );
};

export default Header;
